import React, {useEffect, useState} from 'react'

const ListRandom = () => {
  const [loading, setLoading] = useState(false)
  const [randomNsn, setRandomNsn] = useState()

  console.log('check')
  const fetchRandom = async ()=> {
      setLoading(true)
      let data = await fetch('random_list')
      console.log('Entered')
      console.log(data)
      setRandomNsn(data)
      setLoading(false)
  }

  const waiting = (
    <div>
        spinny thing here
    </div>

  )

  const nsnList = (
    <div>
        randomNsn Mapping { randomNsn }
    </div>
  )

  useEffect(()=>{
    fetchRandom()
  }, [])

  return ( 
    <div>
      Random List of 15 NSN
      {loading ? waiting : nsnList}
    </div>
   );
}
 
export default ListRandom;
